import jsonData from '../data/data.json';
import "../styles/Contacts.css"; 

function Contacts() {
    return (
    <div className='contacts' id='contacts'>
        <h3>Contacts</h3>
        <ul>
            <li>{jsonData.francais.contact[0].telephone} : {jsonData.informations.telephone}</li>
            <li>{jsonData.francais.contact[1].city} : {jsonData.informations.city}</li>
            <li>{jsonData.francais.contact[2].mail}: <a href={`mailto:${jsonData.informations.mail}`}>{jsonData.informations.mail}</a></li>
            <li>{jsonData.francais.contact[3].linkedin}: <a href={jsonData.informations.linkedin} target="_blank">lien</a></li>
            <li>{jsonData.francais.contact[4].github}: <a href={jsonData.informations.github} target='_blank'>Lien</a></li>
        </ul>
    </div>
    );
}

export default Contacts;
